module('Screen2D', {
	setup: function () {
		var divs = [],
				container = document.getElementById('testPlots'),
				i;
		
		for (i = 1; i <= 10; i++) {
			divs.push(document.createElement('div'));
		}
		
		divs.forEach(function (div, n) {
			div.id = 'screen' + (n + 1);
			div.className = 'screenDiv';
			container.appendChild(div);
		});
		
	},
	teardown: function () {
		document.getElementById('testPlots').innerHTML = '';
	}
});


asyncTest('.background', 4, function (assert) {
	var defaultBackgroundCanvas = new MathLib.Screen2D('screen1', 
				{renderer: 'Canvas', width: 300, height: 300, range: {x: 3, y:3}}
			),
			modifiedBackgroundCanvas = new MathLib.Screen2D('screen2', 
				{renderer: 'Canvas', width: 300, height: 300, range: {x: 3, y:3}, background: 0x00AAFF}
			),
			defaultBackgroundSvg = new MathLib.Screen2D('screen3',
				{renderer: 'SVG', width: 300, height: 300, range: {x: 3, y:3}, axes: false, grid: false}
			),
			modifiedBackgroundSvg = new MathLib.Screen2D('screen4', 
				{renderer: 'SVG', width: 300, height: 300, range: {x: 3, y:3}, axes: false, grid: false, background: 0x00AAFF}
			);

	assert.imageEqual(defaultBackgroundCanvas.layer.back.element, 'data:image/png;base64,');
	assert.imageEqual(modifiedBackgroundCanvas.layer.back.element, 'data:image/png;base64,');

	assert.imageEqual(defaultBackgroundSvg.element, 'data:image/png;base64,');
	assert.imageEqual(modifiedBackgroundSvg.element, 'data:image/png;base64,');
});



asyncTest('.pixel', 2, function (assert) {
	var dataURL = 'data:image/png;base64,',
			canvas = new MathLib.Screen2D('screen1', 
				{renderer: 'Canvas', width: 300, height: 300, range: {x: 3, y:3}}
			),
			svg = new MathLib.Screen2D('screen2',
			{renderer: 'SVG', width: 300, height: 300, range: {x: 3, y:3}, axes: false, grid: false}
			);

	canvas.pixel(function (x, y) {
		var c = new MathLib.Complex(x, y);
		return MathLib.argToRgba(c.sin().arg());
	}, 3, 3, -3, -3);
            
	svg.pixel(function (x, y) {
		var c = new MathLib.Complex(x, y);
		return MathLib.argToRgba(c.sin().arg());
	}, 3, 3, -3, -3);

	assert.imageEqual(canvas.layer.main.element, dataURL);
	assert.imageEqual(svg.element, dataURL);
});



