asyncTest('.path (1 function)', 2, function (assert) {
	var dataURL = 'data:image/png;base64,',
			canvas = new MathLib.Screen2D('screen1', 
				{renderer: 'Canvas', width: 300, height: 300, range: {x: 1.1, y: 1.1}}
			),
			svg = new MathLib.Screen2D('screen2', 
				{renderer: 'SVG', width: 300, height: 300, range: {x: 1.1, y: 1.1}, grid: false, axes: false, background: 'transparent'}
			);
      
	canvas.path(MathLib.sin);
	canvas.path(MathLib.exp, {lineColor: 0xFF00AA, lineWidth: 10});
	canvas.path(MathLib.cos, {lineColor: 0x00AAFF, fillColor: 'rgba(0,170,255,0.5)'});
	canvas.path(MathLib.log, {lineColor: 'transparent', fillColor: 'rgba(170,255,0,0.5)'});
	canvas.path(function (x) {return MathLib.arccsc(2 * x) / 2;}, {lineColor: 'rgb(150,100,50)', fillColor: 'rgba(150,100,50,0.2)'});
	canvas.path(MathLib.sqrt, {dash: [0.1], lineColor: 0xFFAA00});
	// The domain of this function is not in the current view box.
	// We are just ensuring, that a path which is not on the screen does not give an error
	canvas.path(function (x) {return MathLib.arcsec(x / 2);});


  
	svg.path(MathLib.sin);
	svg.path(MathLib.exp, {lineColor: 0xFF00AA, lineWidth: 10});
	svg.path(MathLib.cos, {lineColor: 0x00AAFF, fillColor: 'rgba(0,170,255,0.5)'});
	svg.path(MathLib.log, {lineColor: 'transparent', fillColor: 'rgba(170,255,0,0.5)'});
	svg.path(function (x) {return MathLib.arccsc(2 * x) / 2;}, {lineColor: 'rgb(150,100,50)', fillColor: 'rgba(150,100,50,0.2)'});
	svg.path(MathLib.sqrt, {dash: [0.1], lineColor: 0xFFAA00});
	svg.path(function (x) {return MathLib.arcsec(x / 2);});
	
  
	assert.imageEqual(canvas.layer.main.element, dataURL);
	assert.imageEqual(svg.element, dataURL);
});



asyncTest('.path (2 functions)', 2, function (assert) {
	var dataURL = 'data:image/png;base64,',
			canvas = new MathLib.Screen2D('screen1', 
				{renderer: 'Canvas', width: 300, height: 300, range: {x: 1.1, y: 1.1}}
			),
			svg = new MathLib.Screen2D('screen2', 
				{renderer: 'SVG', width: 300, height: 300, range: {x: 1.1, y: 1.1}, grid: false, axes: false, background: 'transparent'}
			);

	canvas.path([MathLib.cos, MathLib.sin], {lineColor: 0x00AAFF, dash: [0.1]});
	canvas.path([function (x) {return Math.pow(Math.cos(x), 3);}, function (x) {return Math.pow(Math.sin(x), 3);}], {lineColor: 0x00FFAA, dash: [0.1]});
	canvas.path([function (x) {return Math.pow(Math.cos(x), 3);}, function (x) {return Math.pow(Math.sin(x), 3);}], {lineColor: 0xAA00FF, dash: [0.1], dashOffset: 0.1});
	canvas.path([function (x) {return Math.pow(Math.cos(x), 5);}, function (x) {return Math.pow(Math.sin(x), 5);}], {lineColor: 0xFFAA00, lineWidth: 10, fillColor: 'rgba(0,170,255,0.5)'});

	svg.path([MathLib.cos, MathLib.sin], {lineColor: 0x00AAFF, dash: [0.1]});
	svg.path([function (x) {return Math.pow(Math.cos(x), 3);}, function (x) {return Math.pow(Math.sin(x), 3);}], {lineColor: 0x00FFAA, dash: [0.1]});
	svg.path([function (x) {return Math.pow(Math.cos(x), 3);}, function (x) {return Math.pow(Math.sin(x), 3);}], {lineColor: 0xAA00FF, dash: [0.1], dashOffset: 0.1});
	svg.path([function (x) {return Math.pow(Math.cos(x), 5);}, function (x) {return Math.pow(Math.sin(x), 5);}], {lineColor: 0xFFAA00, lineWidth: 10, fillColor: 'rgba(0,170,255,0.5)'});

	assert.imageEqual(canvas.layer.main.element, dataURL);
	assert.imageEqual(svg.element, dataURL);
});



